// ==UserScript==
// @name         MusicNotes download
// @version      0.3
// @description  Download any sheet music as png
// @author       FisheyLP
// @match        https://www.musicnotes.com/sheetmusic/*
// @namespace http://tampermonkey.net/
// @downloadURL https://update.greasyfork.org/scripts/372247/MusicNotes%20download.user.js
// @updateURL https://update.greasyfork.org/scripts/372247/MusicNotes%20download.meta.js
// ==/UserScript==

/* globals $ */

(function() {
    'use strict';

    const title = $('.info-table p:eq(1)').text();
    const author = $('.info-table a:first').text();

    $('.svg-product-display').click(function() {
        const page = parseInt($('#lblPageNumber').text().split(' ')[0]);
        const a = document.createElement('a');
        a.download = `${title} - ${author} (${page}).png`;

        if (page > 1) {
            a.href = document.getElementById('nonPlayableCanvas').toDataURL('image/png');
            return a.click();
        }

        const img = new Image();
        const svg = document.getElementById('productSvg');
        const serializer = new XMLSerializer();

        svg.insertAdjacentHTML('beforeend', '<defs><style type="text/css">@font-face {font-family: "Doremi";src: url("data:font/x-woff;base64,");font-weight: normal;font-style: normal; }</style></defs>');

        const xml = serializer.serializeToString(svg);
        img.src = 'data:image/svg+xml,' + encodeURIComponent(xml);

        img.onload = function() {
            const canvas = document.createElement('canvas');
            const context = canvas.getContext('2d');

            canvas.width = 2480;
            canvas.height = 3508;

            context.fillStyle = 'white';
            context.fillRect(0, 0, canvas.width, canvas.height);
            context.drawImage(img, 0, 0);

            a.href = canvas.toDataURL('image/png');
            a.click();
        }
    });
})();